import React from "react";

export default function TableRecords({ registros, filtrar }) {
  return (
    <>
      {registros?.length >= 1 && (
        <table>
          <thead>
            <tr>
              <th>#</th>
              <th>Titulo</th>
              <th>Detalhes</th>
            </tr>
          </thead>
          {
            <tbody>
              {registros.map((registro) => {
                return (
                  <tr>
                    <td>{registro.id}</td>
                    <td>{registro.title}</td>
                    <td>
                      {" "}
                      <button href={`${registro.id}`}>Visualizar</button>
                    </td>
                  </tr>
                );
              })}
            </tbody>
          }
        </table>
      )}
    </>
  );
}
